export interface IPetARRElement extends IElementBase {
	/**宠物id*/
	id: number
	/**宠物蛋及强化等级（策划用）*/
	Egg: string
	/**宠物名称（策划用）*/
	Name: string
	/**预制体guid*/
	ModelGuid: string
	/**宠物名字*/
	petName: string
	/**特效 特效表id*/
	PetEffect: Array<number>
	/**1=地面；2=飞行*/
	MoveWay: number
	/**1=普通体 2=巨大化*/
	Shape: number
	/**uiGuid*/
	uiGuid: string
	/**品质*/
	Quality: string
	/**品质分类1=普通，2=稀有；3=史诗，4=传说，5=神话*/
	QualityType: number
	/**合成等级普通=0黄金化=1彩虹化=2*/
	DevType: number
	/**对应黄金化宠物id黄金化及以上可不填*/
	goldID: number
	/**对应彩虹化宠物id彩虹化及以上可不填*/
	RainBowId: number
	/**特殊化 不填就是没有*/
	Special: string
	/**宠物攻击力 最大值最小值*/
	PetAttack: Array<number>
	/**宠物跟随速度 cm/s*/
	PetSpeed: number
	/**宠物追击速度 cm/s*/
	PetChase: number
	/**是否可以融合产出*/
	IfFuse: number
	/**扭蛋动画宠物相对位移*/
	AnimLocation: mw.Vector
	/**扭蛋动画宠物相对旋转*/
	AnimRotation: Array<number>
	/**扭蛋动画宠物相对缩放*/
	AnimScale: mw.Vector
	/**对象类型(0:GameObject;
1:Character)龙娘为1人形对象*/
	CharacterType: number
	/**翅膀guid*/
	wingGuid: string
	/**翅膀相对位置||旋转||缩放*/
	wingTransform: Array<Array<number>>
}
